import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';
import NicknameEditForm from '../components/NicknameEditForm';
import FollowingsList from '../components/FollowingsList';
const Profile = () => {

const followerList =[{nickname:'김윤중'},{nickname:'이재너'},{nickname:'조진'}];
const followingsList=[{nickname:'ㅗ'},{nickname:'ㅎ'},{nickname:'ㅇ'}];

    return (
        <>
            <Head>
                <meta charSet="utf-8" />
                <title>My Profile | Pick-Me</title>
            </Head>
            <AppLayout>
                <NicknameEditForm/>
                <FollowingsList header="팔로잉 목록" data={followingsList}/>
                <FollowingsList header="팔로워 목록" data={followerList}/>
            </AppLayout>
        </>

    );

};

export default Profile;
